import "./App.css";
import Header from "./components/Header";
import Task from "./components/Task"; // Import the Task component
import ToDoForm from "./components/ToDoForm"; // Import the ToDoForm component

function App() {
  return (
    <div className="App">
      <Header />
      <div className="task">
        <Task />
      </div>
      <div className="form">
        <ToDoForm />
      </div>
      <div>
        <App />
      </div>
    </div>
  );
}

export default App;
